window.bookSummaryJSON = "<p><b>Duty. Honor. His brothers. His sole possessions.</b><br> </p> <p>Wounded in battle, Zander wakes in a daemon feeding ground, bound to a human female. The origins of the restraints are unknown and the woman - Austin - is a risk for Otherworld exposure. <br> </p> <p>In the midst of human corpses, and with relationships punishable by death, Austin tempts a part of him he locked down his entire existence.<br> </p> <p>Awakened, his inner beast, pulls at its tether, fighting to claim what can never be.<br> </p> <p>The Watchers of the Gray Series by JL Madore, joins the gritty, dark paranormal romance traditions of JR Ward, Sherrilyn Kenyon, and IT Lucas.<br> </p> <p>Devour this pause-resister and join the secret world of the Watchers of the Gray!</p>"; 
